import React from "react"
import "./Modal.scss"

interface TypeModalProps {
    visibleModal: boolean,
    setVisibleModal: (visibleModal: boolean) => void,
    finalyModal: boolean
}


const Modal: React.FC <TypeModalProps> = ({visibleModal, setVisibleModal, finalyModal}) => {


    return(
        <div className="container_modal">
            <h1 className={visibleModal ? "new_game_visible" : "new_game_none"}>New Game</h1>
            <div className={visibleModal ? "btn_modal" : "btn_modal_none"} onClick={() => setVisibleModal(!visibleModal)}><h1>GO!</h1></div>
        </div>
    )
}

export default Modal;
